import React from 'react';
import { Link } from "react-router-dom";
import '../assets/styles/header.scss';
import logo from '../assets/images/logo.png';

function Header() {
	return (
		<header className='header'>
			<div className="header-background"></div>
			<img src={ logo } alt='logo' className='header-icon' />
			<ul className='header-menu'>
				<li>
					<Link className='header-menu__item'>Главная</Link>
				</li>
				<li>
					<Link className='header-menu__item'>Технология</Link>
				</li>
				<li>
					<Link className='header-menu__item'>График полетов</Link>
				</li>
				<li>
					<Link className='header-menu__item'>Гарантии</Link>
				</li>
				<li>
					<Link className='header-menu__item'>О компании</Link>
				</li>
				<li>
					<Link className='header-menu__item'>Контакты</Link>
				</li>
			</ul>
		</header>
	);
}

export default Header;
